ControlPropertyState.AutoRuleBindingString:
Patch(
    Ticket_Messages,/*2.*/
    Defaults(Ticket_Messages),/*3.*/
    {
        Ticket_ID: Int(TicketID.Ticket_ID),
        Message: Text(TextInputCanvas1),
        SenderUserCode: User().Email,
        SenderUserName: User().FullName,
        DateTimeStamp: Now()
    }
);
Refresh(Ticket_Messages);
Reset(TextInputCanvas1);
Set(
    NewMessageContianerVisible,
    false
);

// Determine the mode of the TicketDataEditForm and set the NewTicket flag accordingly
Set(
    IsNewTicket,
    TicketDataEditForm.Mode = FormMode.New
);
// Clear and collect data into TicketDataFormProcess based on the mode
ClearCollect(
    TicketDataFormProcess,
    {
        Ticket_ID: DataCardValue31.Text,
        NewTicket: IsNewTicket,
        Subject: DataCardValue36.Value,
        TicketBody: DataCardValue35.Value,
        SiteID: DataCardValue37.Selected.ID,
        TicketCategoryID: DataCardValue34.Selected.ID,
        TicketStatusID: DataCardValue30.Selected.ID,
        Private: If(
            CheckboxCanvas_Private.Checked,
            1,
            0
        ),
        SeverityID: DataCardValue38.Selected.ID,
        AssetID: DataCardValue57.Selected.ID,
        TicketContactName: DataCardValue32.Selected.displayName,
        TicketContactEmail: DataCardValue32.Selected.mail,
        AssignedName: DataCardValue55.Selected.displayName,
        AssignedEmail: DataCardValue55.Selected.mail,
        Ticket_Status_Id: DataCardValue30.Selected.ID,
        Followers: Concat(
            DataCardValue20.SelectedItems,
            displayName,
            ","
        ),
        EstimatedCompletionDate: EsitmatedCompleteDate.SelectedDate,
        CreatedDate: If(
            IsNewTicket,
            Now(),
            Created_Date_DataCard1.Default
        ),
        LastModifiedBy: User().FullName,
        LastModifiedDate: Now(),
        ClosedDate: Closed_Date_DataCard1.Update,
        Version: If(
            IsNewTicket,
            1,
            Version_DataCard2.Default + 1
        ),
        CreatedBy: If(
            IsNewTicket,
            User().FullName,
            LastCreatedBy_DataCard1.Default
        )
    }
);
// Notify if there was an issue with the action
If(
    IsBlank(TicketDataFormProcess),
    Notify(
        "There was an issue with this action.",
        NotificationType.Error
    ),
    Set(
        returnID,
        Process_Ticket_Form_Data.Run(JSON(TicketDataFormProcess))
    );

);
Set(
    TicketID,
    LookUp(
        Tickets_Master,
        Ticket_ID = Int(returnID.ticketid)
    );

);
EditForm(TicketDataEditForm);

If(
    TicketDataEditForm.Mode = FormMode.New,
    Set(
        NewMessageContianerVisible,
        false
    );
    Set(
        NewAttachementContainerVisble,
        false
    );
    Set(
        TicketID,
        Blank()
    );

)
